import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';

import Login from './components/LoginPage'

function App() {
  return (
    <Router>
    <div className="App">
      <header className="App-header">
          <Switch>
            <Route exact path="/">
              <p>
                Homepage
              </p>
            </Route>
            <Route path="/login">
              <Login />
            </Route>
            <Route path="/signup">
              <Login />
            </Route>
          </Switch>
      </header>
    </div>
    </Router>
  );
}

export default App;
